import React from 'react';
import Card from './robot';

 const robotList = ({Cartoes}) => {
    return ( 
        <div>
                <Card id={cartoes[0].id} name={cartoes[0].name} email={cartoes[0].email}/>
                <Card id={cartoes[1].id} name={cartoes[1].name} email={cartoes[1].email}/>
                <Card id={cartoes[2].id} name={cartoes[2].name} email={cartoes[2].email}/>
                <Card id={cartoes[3].id} name={cartoes[3].name} email={cartoes[3].email}/>
                <Card id={cartoes[4].id} name={cartoes[4].name} email={cartoes[4].email}/>
                <Card id={cartoes[5].id} name={cartoes[5].name} email={cartoes[5].email}/>
                <Card id={cartoes[6].id} name={cartoes[6].name} email={cartoes[6].email}/>
                <Card id={cartoes[7].id} name={cartoes[7].name} email={cartoes[7].email}/>
                <Card id={cartoes[8].id} name={cartoes[8].name} email={cartoes[8].email}/>
        </div>

    )
    }

 export default robotList;
